import { AiOutlineHeart, AiOutlineHome, AiOutlineSearch } from 'react-icons/ai';

export default function Footer () {
    return (
        <footer>
            <div>
                <AiOutlineHome size={32} />
                <AiOutlineSearch size={32} />
                <AiOutlineHeart size={32} />
            </div>
        </footer>
    );
}
